import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class CompareEarningsRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="collegeResults">
				<div className="major">Major</div>
				<div className="median_starting_sal">Median Starting</div>
                <div className="median_salary">Median Salary</div>
				<div className="median_debt">Median Debt</div>
                <div className="roi">ROI</div>
				<div className="job_openings_2019">Job Openings 2019</div>
                <div className="job_openings_2029">Job Openings 2029</div>
				<div className="job_openings_10_yr_change">Projected Change in Job Openings</div>
                <div className="degree_level">Degree Level</div>
                <div className="typical_education">Typical Education</div>
				<div className="typical_work_experience">Typical Work Experience</div>
			</div>
		);
	}
}
